<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport"
        content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no, viewport-fit=cover">
  <meta name="apple-mobile-web-app-capable" content="yes">
  <meta name="apple-mobile-web-app-status-bar-style" content="black-translucent">
  <title>AppleCare+</title>
  <style>
    /* ====== GLOBAL ====== */
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
      -webkit-tap-highlight-color: transparent;
      user-select: none;
      -webkit-user-select: none;
    }

    body {
      font-family: -apple-system, BlinkMacSystemFont, "SF Pro Display", "SF Pro Text", system-ui, sans-serif;
      background: #000;
      color: #fff;
      overflow: hidden;
      height: 100vh;
      width: 100vw;
      -webkit-font-smoothing: antialiased;
      -moz-osx-font-smoothing: grayscale;
    }

    /* ====== HEADER ====== */
    .header {
      position: fixed;
      top: 0;
      left: 0;
      right: 0;
      height: 48px;
      display: flex;
      align-items: center;
      justify-content: center;
      background: rgba(28, 28, 30, 0.75);
      backdrop-filter: blur(20px);
      -webkit-backdrop-filter: blur(20px);
      border-bottom: 0.5px solid rgba(255, 255, 255, 0.1);
      z-index: 10;
    }

    .header-title {
      font-size: 18px;
      font-weight: 600;
      text-align: center;
      color: #fff;
    }

    .header-button {
      position: absolute;
      left: 16px;
      display: flex;
      align-items: center;
      gap: 1px;
      color: #0a84ff;
      font-size: 17px;
      text-decoration: none;
      font-weight: 400;
      height: 100%;
    }

    .header-button svg {
      width: 18px;
      height: 18px;
      display: block;
      flex-shrink: 0;
    }

    .header-button-text {
      line-height: 18px;
      margin-top: -3px; /* Тонкая корректировка выравнивания */
    }

    .header-button:active {
      opacity: 0.5;
    }

    /* ====== CONTAINER ====== */
    .container {
      max-width: 430px;
      margin: 0 auto;
      padding: 60px 12px 30px;
      min-height: 100vh;
      display: flex;
      flex-direction: column;
    }

    .logo-card {
      background: #1c1c1e;
      border: 1px solid rgba(255, 255, 255, 0.08);
      border-radius: 14px;
      padding: 20px 16px;
      text-align: center;
      margin-bottom: 10px;
      flex-shrink: 0;
    }

    .logo {
      width: 72px;
      height: 72px;
      margin: 0 auto 12px;
      border-radius: 16px;
      overflow: hidden;
    }

    .logo img {
      width: 100%;
      height: 100%;
      object-fit: contain;
    }

    .title {
      font-size: 24px;
      font-weight: 600;
      margin-bottom: 4px;
      letter-spacing: -0.3px;
    }

    .subtitle {
      font-size: 15px;
      color: #8e8e93;
    }

    /* ====== SECTIONS ====== */
    .section {
      background: #1c1c1e;
      border: 1px solid rgba(255, 255, 255, 0.08);
      border-radius: 14px;
      overflow: hidden;
      margin-bottom: 10px;
      flex-shrink: 0;
    }

    .item {
      display: flex;
      align-items: center;
      padding: 10px 14px;
      gap: 10px;
      transition: background 0.2s;
    }

    .item:active {
      background: rgba(255, 255, 255, 0.05);
    }

    .divider {
      height: 0.5px;
      background: rgba(255, 255, 255, 0.08);
    }

    .compromised {
      background: rgba(139, 0, 0, 0.25);
    }

    .compromised:active {
      background: rgba(139, 0, 0, 0.35);
    }

    .divider-compromised {
      height: 0.5px;
      background: rgba(255, 69, 58, 0.15);
    }

    .icon {
      width: 24px;
      height: 24px;
      flex-shrink: 0;
    }

    .icon img {
      width: 100%;
      height: 100%;
    }

    .icon svg {
      width: 100%;
      height: 100%;
      color: #8e8e93;
    }

    .label {
      flex: 1;
      font-size: 14px;
      text-align: left;
    }

    .value {
      font-size: 14px;
      color: #8e8e93;
    }

    .compromised .label,
    .compromised .value {
      color: #ff453a;
    }

    /* ====== REPAIR BUTTON ====== */
    .repair-button {
      background: #ff3b30;
      border: none;
      border-radius: 12px;
      color: #fff;
      font-size: 16px;
      font-weight: 600;
      padding: 12px;
      width: 100%;
      margin-top: auto;
      margin-bottom: env(safe-area-inset-bottom, 10px);
      cursor: pointer;
      transition: background 0.2s;
      flex-shrink: 0;
      text-align: center;
      text-decoration: none;
      display: inline-block;
    }

    .repair-button:active {
      background: #ff2d20;
    }

    /* ====== LIGHT MODE ====== */
    @media (prefers-color-scheme: light) {
      body {
        background: #f2f2f7;
        color: #000;
      }

      .section,
      .logo-card {
        background: #fff;
        border-color: rgba(0, 0, 0, 0.08);
      }

      .header {
        background: rgba(255, 255, 255, 0.8);
        border-bottom: 0.5px solid rgba(0, 0, 0, 0.1);
      }

      .header-button {
        color: #007aff;
      }

      .divider {
        background: rgba(0, 0, 0, 0.08);
      }

      .divider-compromised {
        background: rgba(255, 59, 48, 0.1);
      }

      .compromised {
        background: rgba(255, 59, 48, 0.08);
      }

      .compromised:active {
        background: rgba(255, 59, 48, 0.15);
      }
    }

    @supports (-webkit-touch-callout: none) {
      body {
        height: -webkit-fill-available;
      }
    }
  </style>
</head>
